import './App.css';

function ToDoItem(props){
    return(
        <div className="ToDoItems">
            <h2>{props.task.title}</h2>
            <p>completed :- {props.task.completed ? 'Yes' : 'No'} </p>
            <button onClick={props.onDelete}>Delete</button>
            <br/>
        </div>
    )
}
export default ToDoItem;
